        return ( 

            <div>
                <button style={this.btnStyle()} className="btn btn-primary btn-sm" >
                    add
                </button>
                <EmployeeTable/>
            </div>

         );
    }

    btnStyle() {
        let styles = {
            'margin': '20px 20px 0px 20px'
          }
          return styles;        
    }
}

export default curdEmployee;
